import { searchContainer, searchInput } from './SearchBar.styles'
export default function SearchBar(props) {
   return (
      <searchContainer>
         <searchInput type='search'/>
         <button className={style.button} onClick={()=> props.onSearch(1)}>Agregar</button>
      </searchContainer>
   );
}
